import './Header.css';

function Header() {
  return (
    <div className="Header">
        <svg src="./solana-sol-logo.svg" className="Sol-logo" alt="logo" />
        <svg src="./hamburger.svg" className="hamburger" alt="menu" />
    </div>
  );
}

export default Header;
